import React, { useState, useEffect } from "react";
import RequestTable from "./RequestTable"; // Create a separate file for the table

const Dashboard = () => {
  const [requests, setRequests] = useState([]);

  useEffect(() => {
    // Fetching mock data; replace with API call later
    const fetchData = async () => {
      const mockData = [
        {
          id: 1,
          name: "John Doe",
          pageUrl: "https://example.com",
          description: "Broken link on the page",
        },
        {
          id: 2,
          name: "Jane Smith",
          pageUrl: "https://example.com/about",
          description: "Missing images",
        },
      ];
      setRequests(mockData);
    };
    fetchData();
  }, []);

  return (
    <div>
      <h1>Requests Dashboard</h1>
      <RequestTable requests={requests} />
    </div>
  );
};

export default Dashboard;
